import React from 'react';

import '../Style/Home.css';

class Home extends React.Component {
    render(){
        return(
           <div>
               <div className="content-wrapper">
                   <div className="content">
                       <img className= "banner-top" src= {require('../Images/top_bg.jpg')} alt="Gaming console"/>
                   </div>

                   <div className= "avatar-div">
                       <img className= "avatar" src= {require('../Images/avatar.jpg.jpg')} alt="Avatar"/>
                   </div>

                   <div className= "introducton-panel">

                   </div>
               </div>
           </div>
        )
    }
}

export default Home;
